import React from 'react'
import { Card } from 'react-bootstrap'

export default function Login() {
    return (
        <Card>
            <Card.Header>
                <div>
                    <FontAwesomeIcon icon={faSave} style={{ color: '#e2821d' }} />  Login
                </div>
            </Card.Header>
        </Card>
    )
}
